import React from "react";

export const Search = () => {
  return (
    <>
    <form action="" >
        <label htmlFor=""></label>
      <select
        class="form-select form-select-sm"
        aria-label=".form-select-sm example"
      >
        <option selected>Blood Group</option>
        <option value="1">One</option>
        <option value="2">Two</option>
        <option value="3">Three</option>
      </select>
      </form>
    </>
  );
};
